import schedule from 'node-schedule';


/**
 * Base Job class
 */
class Job {
  /**
   * Constructor
   *
   * @param {Object} param param
   * @param {number} param.id Job id
   * @param {string} param.pattern pattern string
   * @param {Object} param.user Hubot user
   * @param {Object} param.meta Data for Job
   * @param {Function} [param.cb] callback
   */
  constructor({id, pattern, user, meta, cb}) {
    /**
     * Job id
     *
     * @type {number}
     */
    this.id = id;

    /**
     * pattern
     *
     * @type {string}
     */
    this.pattern = pattern;

    /**
     * Instance of node-schedule Job
     *
     * @type {Object|null}
     */
    this.job = null;

    /**
     * Object of serialized Hubot user
     *
     * @type {Object}
     */
    this.user = {};

    /**
     * Data for Job
     *
     * @type {Object}
     */
    this.meta = meta;

    /**
     * Callback
     *
     * @type {Function?}
     */
    this.cb = cb;

    Object.keys(user).forEach(k => {
      this.user[k] = user[k];
    });
  }

  /**
   * Execute Job
   *
   * @param {Object} robot Hubot robot
   */
  exec(robot) {  // eslint-disable-line no-unused-vars
    // ex.
    //
    // ```
    // envelope = @getEnvelope()
    // {message} = @meta
    // return -> robot.send envelope, message
    // ```
    throw new Error('NotImplemented');
  }

  /**
   * Get Hubot room id
   *
   * @return {string}
   */
  getRoom() {
    return this.user.room || this.user.reply_to;
  }

  /**
   * Get envelope for robot
   *
   * @return {Object}
   */
  getEnvelope() {
    return {user: this.user, room: this.getRoom()};
  }

  /**
   * Start Job
   *
   * @param {Object} robot Hubot robot
   */
  start(robot) {
    this.job = schedule.scheduleJob(this.pattern, () => {
      this.exec(robot);
      if (this.cb) {
        this.cb();
      }
    });
  }

  /**
   * Cancel Job
   */
  cancel() {
    if (this.job) {
      this.job.cancel();
    }
    if (this.cb) {
      this.cb();
    }
  }

  /**
   * Serialize Job data
   *
   * @return {Object}
   */
  serialize() {
    const {pattern, meta, user} = this;
    return {pattern, meta, user};
  }
}

export default Job;

import {difference, getPatternType} from './utils';
import {JobNotFound} from './errors';

const DEFAULT_JOB_MAX_COUNT = 10000;


/**
 * Scheduler
 */
class Scheduler {
  /**
   * Constructor
   *
   * @param {Object} params params
   * @param {Object} params.robot Hubot robot object
   * @param {string} params.storeKey key of Hubot brain
   * @param {Object} params.job Job class
   * @param {number} [params.jobMaxCount=10000] max number of jobs
   */
  constructor({robot, storeKey, job, jobMaxCount = DEFAULT_JOB_MAX_COUNT}) {
    /**
     * Job list
     *
     * @type {Object}
     */
    this.jobs = {};

    /**
     * Hubot robot object
     *
     * @type {Object}
     */
    this.robot = robot;

    /**
     * key of Hubot brain
     *
     * @type {string}
     */
    this.storeKey = storeKey;

    /**
     * Job class
     *
     * @type {Job}
     */
    this.JobCls = job;

    /**
     * Max number of jobs
     *
     * @type {number}
     */
    this.jobMaxCount = jobMaxCount;

    this.robot.brain.on('loaded', () => this.syncBrain());
    this.initBrain();
  }

  /**
   * Initialize Hubot brain
   */
  initBrain() {
    if (!this.robot.brain.get(this.storeKey)) {
      this.robot.brain.set(this.storeKey, {});
    }
  }

  /**
   * Cancel Job
   *
   * @param {number} id Job id
   */
  cancelJob(id) {
    const job = this.jobs[id];
    if (!job) {
      throw new JobNotFound();
    }
    job.cancel();
    delete this.jobs[id];
    delete this.robot.brain.get(this.storeKey)[id];
  }

  /**
   * Create new Job
   *
   * @param {Object} params params
   * @param {string} params.pattern Cron pattern or Date string
   * @param {Object} params.user Target Hubot user
   * @param {Object} params.meta data for using Job
   * @param {number} [params.id] Job id
   * @return {Job}
   */
  createJob({pattern, user, meta, id}) {
    const jobId = id || this.createId();
    const patternType = getPatternType(pattern);
    let job = null;
    if (patternType === 'cron') {
      job = this.createCronJob({pattern, user, meta, id: jobId});
    } else {
      job = this.createDateJob({pattern, user, meta, id: jobId});
    }
    job.start(this.robot);
    this.jobs[jobId] = job;
    this.storeJobToBrain(jobId, job);
    return job;
  }

  /**
   * Create Job id
   *
   * @return {number}
   */
  createId() {
    let id = null;
    while (!id || this.jobs[id]) {
      id = Math.floor(Math.random() * this.jobMaxCount);
    }
    return id;
  }

  /**
   * Create new CronJob
   *
   * @param {Object} params params
   * @param {string} params.pattern Cron pattern
   * @param {Object} params.user Target Hubot user
   * @param {Object} params.meta Data for using Job
   * @param {number} params.id Job id
   * @return {Job}
   */
  createCronJob({pattern, user, meta, id}) {
    return new this.JobCls({id, pattern, user, meta});
  }

  /**
   * Create new DateJob
   *
   * @param {Object} params params
   * @param {string} params.pattern Date string
   * @param {Object} params.user Target Hubot user
   * @param {Object} params.meta Data for using Job
   * @param {number} params.id Job id
   * @return {Job}
   */
  createDateJob({pattern, user, meta, id}) {
    return new this.JobCls({
      id,
      user,
      meta,
      pattern: new Date(pattern),
      cb: () => {
        delete this.jobs[id];
        delete this.robot.brain.get(this.storeKey)[id];
      }
    });
  }

  /**
   * Create new Job from brain
   *
   * @param {number} id Job id
   * @param {Object} data Date for Job
   * @returns {Job}
   */
  createJobFromBrain(id, data) {
    const {pattern, user, meta} = data;
    return this.createJob({pattern, user, meta, id});
  }

  /**
   * Store Job to brain
   *
   * @param {number} id Job id
   * @param {Job} job Job
   */
  storeJobToBrain(id, job) {
    this.robot.brain.get(this.storeKey)[id] = job.serialize();
  }

  /**
   * Sync Jobs from Brain
   */
  syncBrain() {
    this.initBrain();
    const nonCachedJobs = difference(this.robot.brain.get(this.storeKey), this.jobs);
    Object.getOwnPropertyNames(nonCachedJobs).forEach(id => {
      const jobData = nonCachedJobs[id];
      this.createJobFromBrain(id, jobData);
    });
    const nonStoredJobs = difference(this.jobs, this.robot.brain.get(this.storeKey));
    Object.getOwnPropertyNames(nonStoredJobs).forEach(id => {
      const job = nonStoredJobs[id];
      this.storeJobToBrain(id, job);
    });
  }

  /**
   * Update existes Job
   *
   * @param {number} id Job id
   * @param {Object} meta Data for Job
   */
  updateJob(id, meta) {
    const job = this.jobs[id];
    if (!job) {
      throw new JobNotFound();
    }
    job.meta = meta;
    this.robot.brain.get(this.storeKey)[id] = job.serialize();
  }
}

export default Scheduler;

/**
 * JobNotFound
 */
export class JobNotFound extends Error {  // eslint-disable-line require-jsdoc
  /**
   * Constructor
   *
   * @param {string} message message
   */
  constructor(message = 'Job ID does not exists.') {
    super(message);

    /**
     * @type {string}
     */
    this.name = 'JobNotFound';
  }
}


/**
 * InvalidPattern
 */
export class InvalidPattern extends Error {  // eslint-disable-line require-jsdoc
  /**
   * Constructor
   *
   * @param {string} message message
   */
  constructor(message = 'Invalid pattern.') {
    super(message);

    /**
     * @type {string}
     */
    this.name = 'InvalidPattern';
  }
}


/**
 * AlreadyPassedPattern
 */
export class AlreadyPassedPattern extends Error {  // eslint-disable-line require-jsdoc
  /**
   * Constructor
   *
   * @param {string} message message
   */
  constructor(message = 'Pattern date already passed.') {
    super(message);

    /**
     * @type {string}
     */
    this.name = 'AlreadyPassedPattern';
  }
}

import Job from './Job';
import Scheduler from './Scheduler';
import {
  AlreadyPassedPattern,
  InvalidPattern,
  JobNotFound
} from './errors';

export {
  Job,
  Scheduler,
  AlreadyPassedPattern,
  InvalidPattern,
  JobNotFound
};

import cronParser from 'cron-parser';
import {AlreadyPassedPattern, InvalidPattern} from './errors';


/**
 * Diff of Object
 *
 * @param {Object} obj1 target object
 * @param {Object} obj2 target object
 * @return {Object}
 */
export function difference(obj1 = {}, obj2 = {}) {
  const diff = {};
  Object.keys(obj1).forEach(id => {
    const job = obj1[id];
    if (!obj2[id]) {
      diff[id] = job;
    }
  });
  return diff;
}


/**
 * is Cron pattern
 *
 * @param {string} pattern pattern string
 * @return {boolean}
 */
export function isCronPattern(pattern) {
  const errors = cronParser.parseString(pattern).errors;
  return !Object.keys(errors).length;
}


/**
 * Return pattern type (`cron` or `date`)
 *
 * @param {string} pattern pattern string
 * @return {string}
 */
export function getPatternType(pattern) {
  if (isCronPattern(pattern)) {
    return 'cron';
  }
  const date = Date.parse(pattern);
  if (!isNaN(date)) {
    if (date < Date.now()) {
      throw new AlreadyPassedPattern();
    }
    return 'date';
  }
  throw new InvalidPattern();
}

import assert from 'power-assert';
import clearRequire from 'clear-require';
import sinon from 'sinon';
import {Job, Scheduler} from '../src';

/** @test {Scheduler} */
describe('Scheduler', () => {
  const storeKey = 'brain-key';
  const now = Date.parse('2016-02-10T12:00:00Z');
  const user = {name: 'moqada'};
  const meta = {message: 'we are!'};
  let robot = null;
  let sandbox = null;
  let DummyJob = null;
  let spies = null;
  let brainData = null;
  beforeEach(() => {
    clearRequire('node-schedule');
    sandbox = sinon.sandbox.create();
    sandbox.useFakeTimers(now);
    brainData = {};
    spies = {exec: sandbox.spy()};
    DummyJob = class extends Job {
      exec(robot_) {
        spies.exec(robot_);
      }
    };
    robot = {
      brain: {
        get: sandbox.spy(() => brainData),
        on: sandbox.spy(),
        set: sandbox.spy()
      }
    };
  });
  afterEach(() => {
    sandbox.restore();
  });

  /** @test {Scheduler#constructor} */
  context('constructor()', () => {
    let scheduler = null;
    const job = DummyJob;
    beforeEach(() => {
      scheduler = new Scheduler({robot, storeKey, job});
    });

    it('instance', () => {
      assert(scheduler.robot === robot);
      assert(scheduler.storeKey === storeKey);
      assert(scheduler.JobCls === job);
      assert(scheduler.jobMaxCount === 10000);
    });

    it('set brain.loaded', () => {
      const {args} = robot.brain.on;
      assert(args.length === 1);
      assert(args[0][0] === 'loaded');
      assert(typeof args[0][1] === 'function');
    });
  });

  /** @test {Scheduler#createJob} */
  context('#createJob()', () => {
    let scheduler = null;
    beforeEach(() => {
      scheduler = new Scheduler({robot, storeKey, job: DummyJob});
    });

    it('pattern: * 0 * * *', () => {
      const pattern = '* 0 * * *';
      const job = scheduler.createJob({pattern, user, meta});
      const id = job.id;
      assert(typeof id === 'number');
      assert(scheduler.jobs[id] === job);
      assert.deepEqual(brainData[id], {
        pattern, meta, user
      });
    });

    it('pattern: 2016-02-20', () => {
      const pattern = '2016-02-20';
      const job = scheduler.createJob({pattern, user, meta});
      const id = job.id;
      assert(typeof id === 'number');
      assert(scheduler.jobs[id] === job);
      assert.deepEqual(brainData[id], {
        pattern: new Date(pattern), meta, user
      });
      assert(job.cb);
    });
  });

  /** @test {Scheduler#cancelJob} */
  context('#cancelJob()', () => {
    let scheduler = null;
    beforeEach(() => {
      scheduler = new Scheduler({robot, storeKey, job: DummyJob});
    });

    it('canceled', () => {
      const job = scheduler.createJob({user, meta, pattern: '* 0 * * *'});
      const id = job.id;
      scheduler.cancelJob(id);
      assert(scheduler.jobs[id] === undefined);
      assert(brainData[id] === undefined);
    });

    it('JobNotFound', () => {
      assert.throws(() => {
        scheduler.cancelJob(99999999);
      }, /^JobNotFound: Job ID does not exists.$/);
    });
  });

  /** @test {Scheduler#updateJob} */
  context('#updateJob()', () => {
    let scheduler = null;
    beforeEach(() => {
      scheduler = new Scheduler({robot, storeKey, job: DummyJob});
    });

    it('updated', () => {
      const initData = {user, meta, pattern: '* 0 * * *'};
      const job = scheduler.createJob(initData);
      const id = job.id;
      const data = {message: 'updated'};
      scheduler.updateJob(id, data);
      const updatedData = Object.assign({}, initData, {meta: data});
      assert(scheduler.jobs[id] === job);
      assert.deepEqual(brainData[id], updatedData);
    });

    it('JobNotFound', () => {
      assert.throws(() => {
        scheduler.updateJob(99999999);
      }, /^JobNotFound: Job ID does not exists.$/);
    });
  });

  /** @test {Scheduler#syncBrain} */
  context('#syncBrain()', () => {
    let scheduler = null;
    beforeEach(() => {
      scheduler = new Scheduler({robot, storeKey, job: DummyJob});
    });

    it('sync brain data', () => {
      const existsId = 9999999;
      const initData = {user, meta, pattern: '* 0 * * *'};
      const job = scheduler.createJob(initData);
      brainData = {[existsId]: {user, meta, pattern: '* 1 * * *'}};
      scheduler.syncBrain();
      assert.deepEqual(Object.keys(scheduler.jobs), [job.id, existsId]);
    });

    it('on brain.loaded', () => {
      const existsId = 9999999;
      const initData = {user, meta, pattern: '* 0 * * *'};
      const job = scheduler.createJob(initData);
      brainData = {[existsId]: {user, meta, pattern: '* 1 * * *'}};
      robot.brain.on.args[0][1]();
      assert.deepEqual(Object.keys(scheduler.jobs), [job.id, existsId]);
    });
  });
});
